		// 	url: searchUrl
		// 	}
		//
		// axios.request(options)
		// 	.then((res) => {
		// 		// const resultNotFoundMsg = !res.data.news_results.length
		// 		// 	? 'Tidak Ada Berita'
		// 		// 	: '';
		//
		// 		this.setState({
		// 			articleResults: res,
		// 			// articleMessage: resultNotFoundMsg,
		// 		});
		// 	})
