		// 		if (axios.isCancel(error) || error) {
		// 			this.setState({
		// 				articleMessage: 'Internet Tidak Terdeteksi.',
		// 			});
		// 		}
		// 	});

	}

renderGoogleNews(){
	const {articleResults} = this.state;
	if (Object.keys(articleResults).length && articleResults.length) {
	return (
			<div>
					{articleResults.map((result,i) => {
						return (
							<ArticleCard
								id={articleResults[i].i}
								title={articleResults[i].title}
								snippet={articleResults[i].snippet}
								source={articleResults[i].source}
								date={articleResults[i].date}
								thumbnail={articleResults[i].thumbnail}
							/>
							);
						})}
		</div>


	)}
}

componentDidMount(){
	this.getGoogleNews();
}

	render() {
		const {queryNut, nutritionMessage, articleResults} = this.state;
		return (
			<div>
				<Navbar/>
				<Switch>
					{/*route search*/}
					<Route path="/search"
							render={() => (
								<div className="container">
									{/*Heading*/}
										<div className="row">
											<div className="col-12 bagian-atas">
												<h2>Cari Makanan</h2>
											</div>
											<div className="col-12">
													<input
													 className="form-control me-2 search-custom"
													 type="text"
													 name="queryNut"
													 value={queryNut}
													 placeholder="Search..."
													 onChange={this.handleOnInputChange}
													/>
											</div>
											<div className="col-12"><br/>
												{ nutritionMessage && <h5>{ nutritionMessage }</h5> }
											</div>
										</div>
										<LoadingIndicator/>
										{ this.renderSearchnutritionResults() }
								</div>
							)}
					/>

					{/*route article*/}
					<Route path="/article"
							render={() => (
								<div>
									<div className="container">
						          <div className="row">
												<ArticleCard
													id="1"
													title="ini Judul"
													snippet="ini snipped penjelasan"
													source=""
													date="hari ini"
													thumbnail="data:image/jpeg;base64,\x3d\x3d"
												/>
													<LoadingIndicator/>
						          </div>
						      </div>
								</div>
							)}
					/>
					<Route component={NotFound}/>
				</Switch>
			</div>
		);
	}
}

export default App;
